import React, { Component } from 'react';
import Button from './Button';



class Registry extends Component
{
  render(){
    return(

      <div className="Registry">
        <h1>Soy la seccion del Registro</h1>
        <Button/>
      </div>
    );
  }

}


export default Registry;
